log:
  level: info
dns:
  servers:
    - tag: cloudflare
      address: tcp://1.1.1.1
      strategy: ipv4_only
    - tag: cloudflare_审计
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: 审计
    - tag: cloudflare_OpenAI
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: OpenAI
    - tag: cloudflare_Google
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: Google
    - tag: cloudflare_TikTok
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: TikTok
    - tag: cloudflare_YouTube
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: YouTube
    - tag: cloudflare_Wikipedia
      address: tcp://1.1.1.1
      strategy: ipv4_only
      detour: Wikipedia
    - tag: local
      address: udp://223.5.5.5 #最好是dhcp://auto
      detour: direct
    - tag: system
      address: local
  rules:
    - outbound: any
      server: local
    - inbound: 审计checker-in
      server: cloudflare
    - inbound: 审计checker_无审计-in
      server: cloudflare_审计
    - clash_mode: Direct
      server: local
    - clash_mode: Global
      server: cloudflare
    - domain_suffix:
        - .lan
        - .local
      server: system
    - rule_set: geosite-audit
      server: cloudflare_审计
    - rule_set: geosite-openai
      server: cloudflare_OpenAI
    - rule_set: Google
      server: cloudflare_Google
    - type: logical
      mode: or
      rules:
        - package_name: com.zhiliaoapp.musically
        - rule_set: geosite-tiktok
      server: cloudflare_TikTok
    - rule_set: geosite-youtube
      server: cloudflare_YouTube
    - rule_set: geosite-wikimedia
      server: cloudflare_Wikipedia
    - rule_set: geosite-geolocation-!cn
      server: cloudflare
    - rule_set:
        - geosite-geolocation-cn
        - geoip-cn
      server: local
    - clash_mode: Default
      server: cloudflare
  independent_cache: true
  reverse_mapping: true #解决只靠嗅探udp嗅探不出域名而只用ip分流的问题
inbounds:
  - type: tun
    tag: tun-in
    address:
      - 172.18.0.1/30
      - fdfe:dcba:9876::1/126
    auto_route: true
    strict_route: true
    platform:
      http_proxy:
        enabled: false #mixed域名入站不解析域名直接通过域名分流，导致geoip规则失效
        server: 127.0.0.1
        server_port: 1080
    sniff: true
    route_exclude_address: #为了让局域网主机还能通过IPv4访问本机0.0.0.0服务器
