route:
  rules:
    - inbound: 审计checker-in
      outbound: select
    - inbound: 审计checker_无审计-in
      outbound: 审计
    - clash_mode: Direct
      outbound: direct
    - clash_mode: Global
      outbound: select
    - type: logical
      mode: or
      rules:
        - protocol: dns
        - port: 53
      outbound: dns-out
    - ip_is_private: true
      outbound: direct
    - type: logical
      mode: and
      rules:
        - type: logical
          mode: or
          rules:
            - network: udp
              port:
                - 443
                - 80
            - protocol: quic
        - type: logical #像是clientservices.googleapis.com既属于geosite-geolocation-!cn又属于geosite-geolocation-cn的处理
          mode: or
          rules:
            - rule_set:
                - geosite-geolocation-!cn
            - rule_set:
                - geoip-cn
                - geosite-geolocation-cn
              invert: true
      outbound: block
    - type: logical
      mode: and
      rules:
        - type: logical
          mode: or
          rules:
            - rule_set:
                - geosite-geolocation-!cn
            - rule_set:
                - geoip-cn
                - geosite-geolocation-cn
              invert: true
        - network: udp
      outbound: UDP
    - rule_set: geosite-audit
      outbound: 审计
    - rule_set: geosite-openai
      domain:
        - cdn.auth0.com
      outbound: OpenAI
    - rule_set: Google
      outbound: Google
    - type: logical
      mode: or
      rules:
        - package_name: com.zhiliaoapp.musically
        - rule_set: geosite-tiktok
      outbound: TikTok
    - rule_set: geosite-youtube
      outbound: YouTube
    - rule_set: geosite-wikimedia
      outbound: Wikipedia
    - rule_set:
        - geosite-geolocation-!cn
      outbound: select
    - rule_set:
        - geoip-cn
        - geosite-geolocation-cn
      outbound: direct
    - clash_mode: Default
      outbound: select
    - process_name: #用以启用在ui中显示进程
        - placeholder
      outbound: select
  rule_set:
    - type: remote
      tag: geosite-geolocation-cn
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-geolocation-cn.srs
      download_detour: direct
    - type: remote
      tag: geosite-geolocation-!cn
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-geolocation-!cn.srs
      download_detour: direct
    - type: remote
      tag: geoip-cn
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geoip/rule-set/geoip-cn.srs
      download_detour: direct
    - type: remote
      tag: geosite-openai
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-openai.srs
      download_detour: direct
    - type: remote
      tag: geosite-google
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-google.srs
      download_detour: direct
    - type: remote
      tag: geosite-google@cn
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-google@cn.srs
      download_detour: direct
    - type: inline
      tag: Google
      rules:
        - domain:
            - www.google.com
            - google.com
    - type: remote
      tag: geosite-tiktok
      format: binary
      url: https://raw.githubusercontent.com/SagerNet/sing-geosite/rule-set/geosite-tiktok.srs
